objetoCompra:
Especificação do Objeto:
3.1.1 Executar os serviços em conformidade com este TERMO DE REFERÊNCIA assim como, as
Normas NBC TA 200, aprovada pela Resolução CFC n.º1.203 de 27.11.2009, consistindo
na auditoria das demonstrações contábeis, incluindo contas, balancetes, demonstrações
e análises, demais controles internos, revisão e teste dos procedimentos e controles
existentes sobre as receitas e despesas, bem como dos controles internos existentes na
gestão como um todo, análise do balanço patrimonial, demonstrativo de resultado e
demais demonstrativos contábeis do exercício fiscal correspondente, com a consequente
emissão de relatórios trimestrais e parecer, contendo opinião sobre os referidos
demonstrativos contábeis.
3.1.2 Auditoria das Demonstrações Contábeis, em conformidade com as legislações aplicáveis,
às normas do IBRACON e demais, a saber:
a) - Análise Econômica e Financeira das Demonstrações Contábeis;
b) - Análise dos processos de aquisição de materiais e serviços (licitações e compras diretas);
c) - Conciliação de Saldos Bancários;
d) - Conciliação de aplicações financeiras;
e) - Recebimentos e Pagamentos;
f) - Administração de contratos quanto a prazos, reajustes, execução, penalidades e
pagamentos;
g) - Processos de Pagamentos;
h) - Consistência dos relatórios de informações à Contabilidade, tanto manuais quanto
automatizados;
i) - Controle dos Bens Imóveis (investimentos imobiliários) disponíveis para
comercialização/destinados a cessão de uso;
j) - Controle dos Bens móveis.
3.1.3 Deverão ser produzidos pelo trabalho de Auditoria, trimestralmente, no mínimo os
seguintes relatórios e pareceres:
a) Relatório de análise e recomendações sobre as revisões de procedimentos de cada uma
das áreas examinadas;
b) Relatório de análise e recomendações sobre procedimentos contábeis;
c) Relatório de análise e recomendações decorrentes dos exames de demonstrativos
contábeis;
d) Relatório de Controles Internos;
e) Parecer de auditoria sobre as demonstrações contábeis;
f) Relatório Final de Auditoria.
